import React,{useState} from 'react'
import './h.css';
const App=()=>
    {
        const[name,setName]=useState({
            FIRSTNAME:'',PASSWORD:''
        })
        const {FIRSTNAME,PASSWORD}=name;
  const changehandler=e=>
    {
      setName({...name,[e.target.name]:[e.target.value]})
    }
    const submithandler=e=>
      {
        e.preventDefault()
        console.log(name)
      }
        return(
            <div class="op">

                <center>
                <h2>SIGN UP</h2><br/><br/>
                    <form onSubmit={submithandler}>
                        <label>FIRSTNAME:</label>
                        <input type="text" name="FIRST NAME" value={FIRSTNAME} onChange={changehandler}/><br/><br/><br/>
                        <label>EMAIL:    </label>
                        <input type="email" name="email"/><br/><br/><br/>
                        <label>PASSWORD: </label>
                        <input type="text" name="PASSWORD" value={PASSWORD} onChange={changehandler}/><br/><br/><br/>
                        <label>MOBILE NUMBER:</label>
                        <input type="text" name="MOBILE NUMBER"/><br/><br/><br/>
                        <div className="container">
                        <input type="SUBMIT" name="SUBMIT"/><br/>
                        </div>
                    </form>
                </center>
            </div>

        );
    }
    export default App
